public class Kasus4L4 {
    public static void main(String[] args) {
        int counter = 1;
        System.out.println("Miles		Kilometers");
        System.out.println("-------------------------------");
        // Use while loop
        while (counter <= 10) {
            //Menampilkan hasil
            //counter = miles
            System.out.println(counter + "		" + ConvertMilesToKilo(counter));
            counter++;
        }
    }

    private static double ConvertMilesToKilo(int miles){
        return miles * 1.609;
    }
}

