public class Kasus4 {

    public static double Konversi(int miles) {
        if(miles <=10) {
            System.out.println(miles + "		" + miles * 1.609);
            return Konversi(++miles);
        }
        return 0;
    }

    public static void main(String[] args) {
        System.out.println("Miles		Kilometers");
        System.out.println("-------------------------------");
        // Use while loop
        Konversi(1);
    }
}

