        for (int x = 0; x < 4; x++) {
            for (int y = 0; y< 4; y++) {
                matrix[x][y] = sc.nextDouble();//menginput angka ke dalam array 2d
            }

        }

        System.out.print("Sum of the elements in the major  diagonal is  "+ HitungDiagonal(matrix));//menampilkan fungsi hasil perhitungan diagonal
