                matrix[x][y] = sc.nextDouble();//menginput angka ke dalam array 2d
            }

        }
        double hasil;
        hasil=HitungDiagonal(matrix);                         
        System.out.print("Sum of the elements in the major  diagonal is  "+ hasil);//menampilkan fungsi hasil perhitungan diagonal
