                if(a[x][y] == 1) {
                    a[x][y] = 0;
                    list.add(get(x,y,i,j));
                }
                else if(a[x][y] == 0 && count < 2){
                    a[x][y] = 1;
                    count++;
                    list.add(get(x,y,i,j));
                }
            }
        }
    }

    public static String get(int x, int y, int i, int j){
        if(x == 0 && y == 0) {
            return (i+1) + " " + (j+1);
        }
        else if(x == 0 && y == 1){
            return (i+1) + " " + (j+2);
        }
        else if(x == 1 && y == 0){
