						}
						if(e=='e') {
							freq[4][i]++;
						}
						else {
							freq[4][i]--;
						}

					}
				}


				for(int i=0; i<5; i++) {
					Arrays.sort(freq[i]);
				}

				int ans=0;
				for(int i=0; i<5; i++) {
