			for (int i = 1; i <= n; i++) {
				adj[i] = new ArrayList<>();
			}
			for (int i = 0; i < n - 1; i++) {
				int u = in.nextInt();
				int v = in.nextInt();
				adj[u].add(v);
				adj[v].add(u);
			}
			diam = 0;
			depth[a] = 0;
			dfs(a, -1);

			boolean works = true;

			if (depth[b] <= da) {
				o.println("Alice");
				continue;
			}

			if (2 * da >= diam) {
				o.println("Alice");
				continue;
			}

			if (db > 2 * da) {
				o.println("Bob");
				continue;
			}

			if (db <= 2 * da) {
				o.println("Alice");
			}


		}


        o.close();
