    public class Main {

          static Scanner sc;
          static StringBuilder ans;


          /*-------------- for input in an value ---------------------*/
          static int ni()     { return sc.nextInt();       }







          /*-------------- for input in an array ---------------------*/






          /*-------------- File vs Input ---------------------*/

          static void runIo() throws Exception  {
               sc = new Scanner(System.in);
          }    




















