      if(x.get(i)<q){System.out.println("NO"); return;}
      q+=1;
    }
    System.out.println("YES");
  }
  public static void main(String args[]){
      sc=new Scanner(System.in);
      int t=sc.nextInt();
      while(t-->0) solve();
  }
}

