            int m = in.nextInt();
            int x = in.nextInt();

            List<Block> arr = new ArrayList<>();
            for(int i = 0; i < n; i++) {
                arr.add(new Block(in.nextInt(), i));
            }

            if(m == 1) {
                System.out.println("YES");
                for(int i = 0; i < n; i++) {
                    System.out.print(1 + " ");
                }
                System.out.println();
                continue;
            }
            arr.sort(Comparator.reverseOrder());

            long[] towers = new long[m];
            int ind = 0;
            boolean right = true;

            int[] ans = new int[n];

            for(int i = 0; i < n; i++) {
                int nextInd;
                if(right) {
                    if(ind == m - 1) {
                        right = false;
                        nextInd = ind - 1;
                    } else {
                        nextInd = ind + 1;
                    }
                } else {
                    if(ind == 0) {
                        right = true;
                        nextInd = ind + 1;
                    } else {
                        nextInd = ind - 1;
                    }
                }

                if(towers[ind] <= towers[nextInd]) {
                    towers[ind] += arr.get(i).weight;

                    ans[arr.get(i).index] = ind + 1;
                } else {
                    towers[nextInd] += arr.get(i).weight;

                    ans[arr.get(i).index] = nextInd + 1;
                    ind = nextInd;
                }
            }

            boolean success = true;
            for(int i = 0; i < m - 1; i++) {
                if(Math.abs(towers[i] - towers[i + 1]) > x) {
                    success = false;
                    break;
                }
            }

            if(success) {
                System.out.println("YES");
                for(int i = 0; i < n; i++) {
                    System.out.print(ans[i] + " ");
                }
                System.out.println();
            } else {
                System.out.println("NO");
            }

        }
    }

