public class B{
	static FastScanner sc = new FastScanner();
	static BufferedWriter output = new BufferedWriter(
			new OutputStreamWriter(System.out));


	public static long util(int arr[]) {
		Arrays.sort(arr);
		int i = 0;
		int j = arr.length - 1;
		while(i <= j) {
			int tmp = arr[i];
			arr[i] = arr[j];
			arr[j] = tmp;
			i++;
			j--;
		}
		int n = arr.length;
		//min priority queue
		PriorityQueue<Integer> pq = new PriorityQueue<>();
		long ans = 0;
		long sum = 0;
		long cnt = 0;
		for(int ii: arr) {
			if( ii == 0) cnt++;
		}
		for(i =0;i<n;i++) {

			sum += arr[i];
			ans++;
			if(arr[i] < 0) {
				pq.add(arr[i]);
			}
			if( sum <= 0 ) {
				while( sum <= 0 ) {
					if(pq.isEmpty()) break;
					sum -= pq.peek();
					ans--;
					pq.remove();

				}
			}
		}
		if(sum > 0) 
			return ans;
		return ans - cnt;



	}


	public static void solve() {
