//        int tc = 1;
        for (int rep = 0; rep < tc; rep++) {
            int N = sc.ni();
            int[][] edges= new int[N-1][];
            for (int i = 0; i < edges.length; i++) {
                edges[i] = new int[] {sc.ni() - 1, sc.ni() - 1};
            }
            pw.println(solve(edges, N));


        }
        pw.close();
