			int db=f.nextInt();

			for(int i=0;i<=n;i++)
				g[i]=new ArrayList<>();

			for(int i=1;i<n;i++)
			{
				int x=f.nextInt();
				int y=f.nextInt();

				g[x].add(y);
				g[y].add(x);
			}
			dfs(a,0);
			if(-dist[a]+dist[b] <= da)
			{
				sb.append("Alice
");
				continue;
			}
			int nr=1,mx=0;
			for(int i=1;i<=n;i++)
			{
				if(dist[i]>mx)
				{
					mx=dist[i];
					nr=i;
				}
			}
			vis=new int[n+1];
			dist=new int[n+1];
			dfs(nr,0);
			int dm=0;
			for(int i : dist)
				dm=Math.max(dm,i);
			dm--;
			if(dm<= 2*da)
			{
				sb.append("Alice
");
				continue;
			}
			if(db>2*da)
			{
				sb.append("Bob
");
				continue;
			}
			else
			{
				sb.append("Alice
");
				continue;
			}
		}
		System.out.println(sb);
	}	

	static void dfs(int n,int par) 
	{	
		dist[n]=dist[par]+1;
		vis[n] = 1;
		for (int child : g[n]) {
			if (vis[child] == 0)
				dfs(child,n);
		}

	}


}

